import React, { Component } from 'react';
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBContainer
} from 'mdbreact';
import './mobile-navbar.css';
import { BrowserRouter as Router } from 'react-router-dom';
import { translate } from "react-i18next";

class MobileNav extends Component {
  state = {
    collapseID: ''
  };

  toggleCollapse = collapseID => () => {
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ''
    }));
  };

  render() {
    const { t } = this.props;
    return (
      <div className="mobile-nav__container">
        <Router>
          <MDBContainer>
            <MDBNavbar light className="mobile-nav__mdbnavbar">
              <MDBContainer>
                <MDBNavbarBrand>
                  <img src="/assets/logo-cci.svg" />
                </MDBNavbarBrand>
                <MDBNavbarToggler
                  onClick={this.toggleCollapse('navbarCollapse1')}
                />
                <MDBCollapse
                  id='navbarCollapse1'
                  isOpen={this.state.collapseID}
                  navbar
                >
                  <MDBNavbarNav left>
                    <MDBNavItem active>
                      <MDBNavLink to='#!'>Beetroots</MDBNavLink>
                    </MDBNavItem>
                    <MDBNavItem>
                      <MDBNavLink to='#!'>Horsraddish</MDBNavLink>
                    </MDBNavItem>
                    <MDBNavItem>
                      <MDBNavLink to='#!'>Sea lettuce</MDBNavLink>
                    </MDBNavItem>
                    <MDBNavItem>
                      <MDBNavLink to='#!'>{ t('startBuilding', { framework: "react-i18next" }) }</MDBNavLink>
                    </MDBNavItem>
                  </MDBNavbarNav>
                </MDBCollapse>
              </MDBContainer>
            </MDBNavbar>
          </MDBContainer>
        </Router>
      </div>
    );
  }
}

export default translate('common')(MobileNav);
